function initFAQ(){const e=document.querySelectorAll(".faq-item");e.forEach(t=>{t.addEventListener("toggle",function(){this.open&&e.forEach(e=>{e!==this&&e.open&&(e.open=!1)})})})}document.addEventListener("DOMContentLoaded",initFAQ),window.addEventListener("pageshow",function(e){e.persisted&&console.log("Page restored from bfcache")}),window.addEventListener("pagehide",function(e){e.persisted&&console.log("Page added to bfcache")});
